Hon’ble Lt. Governor of #Jammu &amp; #Kashmir - Shri Manoj Sinha ji inaugurated night parking facility for #GOFIRST aircraft at #Srinagar &amp; Jammu airports on Apr. 21st.

The night parking facility will ensure late night &amp; early morning take-offs from the two airports.
